  selector: 'app-nav-bar',
  templateUrl: './nav-bar.component.html',
  styleUrls: ['./nav-bar.component.scss']
})
export class NavBarComponent {

}
<div
  class="containter"
  style="
    height: 35px;
    display: flex;
    align-items: center;
    justify-content: space-between;
    padding-right: 150px;
    padding-left: 150px;
  "
